package com.foxhis.trustface;

import java.util.HashMap;
import java.util.Map;

import org.eclipse.swt.ole.win32.OleEvent;
import org.eclipse.swt.ole.win32.OleListener;

import com.alibaba.fastjson.JSONObject;

public class TrustFaceDemo {

	public static void main(String[] args) throws Exception {
	
		final TrustFaceCtrl trustFaceCtrl = new TrustFaceCtrl(ITrustFace.grogID);
		trustFaceCtrl.addEventListener(ITrustFace.onCaptureFaceImage, new OleListener() {	
			@Override
			public void handleEvent(OleEvent arg0) {
				// TODO Auto-generated method stub
				System.out.println("采集头像事件触发");
				try {
					String pack = trustFaceCtrl.getFaceVerifyPackage();
					System.out.println("采集的数据包"+pack);
				} catch (Exception e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		});
		trustFaceCtrl.addEventListener(ITrustFace.onCaptureFaceState, new OleListener() {	
			@Override
			public void handleEvent(OleEvent arg0) {
				// TODO Auto-generated method stub
				System.out.println("人像采集状态触发");
				try {
					int result = arg0.arguments[0].getInt();
					if(result==11)
					{
						//trustFaceCtrl.closeFaceWindow();
					}
					System.out.println("采集的数据包"+result);
				} catch (Exception e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		});
		
		trustFaceCtrl.addEventListener(ITrustFace.onGetFaceResult, new OleListener() {		
			@Override
			public void handleEvent(OleEvent arg0) {
				// TODO Auto-generated method stub
				short result = arg0.arguments[0].getShort();
				System.out.println("采集人像反馈"+result);
				String resultInfo = arg0.arguments[0].getString();
				System.out.println("采集人像结果"+resultInfo);
			}
		});
		
		
		short reinit = trustFaceCtrl.initControl();
		System.out.println("InitControl="+reinit);
		
		Map<String, Map<String,Object>> remap = new HashMap<String, Map<String,Object>>();
		Map<String, Object> map = new HashMap<String, Object>();
		map.put("imageWidth", 102);
		map.put("imageHeight", 126);
		map.put("imageType", 1);
		map.put("imageData", "");
		remap.put("photoInfo", map);
		String jsonObject = JSONObject.toJSONString(remap);
		short resetface =trustFaceCtrl.setFaceTemplatePhoto(jsonObject);
		System.out.println("setFaceTemplatePhoto="+resetface);
		
		String setting = "eyJxdWFsaXR5IjoiOTAiLCJ2ZXJpZnlUaW1lIjoiMyJ9";
		short resetserver =trustFaceCtrl.setServerSetting(setting);
		System.out.println("setServerSetting="+resetserver);

	
		short reshow = trustFaceCtrl.showFaceWindow();
		System.out.println("showFaceWindow="+reshow);		
	
		
	}

}
